$id: https://schemas.ceeconnect.fr/bundles/operation
$schema: https://json-schema.org/draft/2020-12/schema
title: Opération d'économies d'énergie
type: object
properties:
  uuid:
    title: Identifiant
    description: Identifiant unique au format UUID
    type: string
    format: uuid
  fiche:
    $ref: https://schemas.ceeconnect.fr/formats/reference_fiche
    title: Fiche d'opération standardisée
  bonification:
    title: Bonification
    $ref: https://schemas.ceeconnect.fr/formats/reference_bonification
  dateVisitePrealable:
    title: Date de la visite préalable
    type: string
    format: date
    formatMaximum:
      $data: /dateEngagement
  dateEngagement:
    title: Date d'engagement de l'opération
    type: string
    format: date
    formatMinimum:
      $data: /dateVisitePrealable
    formatMaximum:
      $data: /dateDebutTravaux
  dateDebutTravaux:
    title: Date de début des travaux
    type: string
    format: date
    formatMinimum:
      $data: /dateEngagement
    formatMaximum:
      $data: /dateAchevement
  dateAchevement:
    title: Date d'achèvement de l'opération
    type: string
    format: date
    formatMinimum:
      $data: /dateDebutTravaux
  volumeCeeClassique:
    title: Volume de CEE classique
    type: integer
    minimum: 0
  volumeCeePrecarite:
    title: Volume de CEE précarité
    type: integer
    minimum: 0
  natureContribution:
    $ref: https://schemas.ceeconnect.fr/enums/nature_contribution
    title: Nature du rôle actif et incitatif
  valeurContribution:
    title: Montant du rôle actif et incitatif
    type: number
    minimum: 0
  adresse:
    $ref: https://schemas.ceeconnect.fr/mixins/adresse#/$defs/france
  beneficiaire:
    $ref: https://schemas.ceeconnect.fr/bundles/beneficiaire
  professionnel:
    $ref: https://schemas.ceeconnect.fr/bundles/professionnel
  precarite:
    $ref: https://schemas.ceeconnect.fr/bundles/precarite
  documents:
    title: Liste des documents
    type: array
    items:
      $ref: https://schemas.ceeconnect.fr/bundles/document
  description:
    title: Descriptif de l'opération
    type: object
required:
  - uuid
  - fiche
  - dateEngagement
  - dateVisitePrealable
  - dateDebutTravaux
  - dateAchevement
  - volumeCeeClassique
  - volumeCeePrecarite
  - natureContribution
  - valeurContribution
  - adresse
  - beneficiaire
  - professionnel
  - installateur
  - precarite
  - documents
  - description
